/* eslint-disable jsx-a11y/anchor-is-valid */
import { Component } from "react";
import 'materialize-css/dist/css/materialize.min.css'

type props = {
    titulo: string,
    tema: string
}

export default class ListaProdutoServico extends Component<props> {
    render() {
        let estiloLink = `collection-item active ${this.props.tema}`
        let estiloBotaoNovo = `btn waves-effect waves-light ${this.props.tema}`
        let titulo = `${this.props.titulo}`
        return (
            <>
            <h5 className="center-align">{titulo}</h5>

            {/* <div className="collection">
                <a className="collection-item">Produto/Serviço 1</a>
                <a className={estiloLink}>Produto/Serviço 2</a>
                <a className="collection-item">Produto/Serviço 3</a>
                <a className="collection-item">Produto/Serviço 4</a>
            </div> */}

            <ul className="collection with-header">
                <li className="collection-header"><h4>First Names</h4></li>
                <li className="collection-item"><div>Alvin<a href="#!" className="secondary-content"><i className="material-icons">edit</i></a></div></li>
                <li className="collection-item"><div>Alvin<a href="#!" className="secondary-content"><i className="material-icons">edit</i></a></div></li>
                <li className="collection-item"><div>Alvin<a href="#!" className="secondary-content"><i className="material-icons">edit</i></a></div></li>
                <li className="collection-item"><div>Alvin<a href="#!" className="secondary-content"><i className="material-icons">edit</i></a></div></li>
            </ul>

            <button className={estiloBotaoNovo} type="submit" name="action">Novo
                <i className="material-icons right">add</i>
            </button>
            </>
        )
    }
}
